import React, { useState, useEffect } from 'react';
import '../styles/Hero.css';
import { FiSearch, FiArrowRight, FiChevronLeft, FiChevronRight } from 'react-icons/fi';

const Hero = () => {
  const images = [
    "/assets/Swiss_chalet_1.jpg",
    "/assets/Swiss_chalet_2.jpg",
    "/assets/Swiss_chalet_3.jpg",
    "/assets/Swiss_chalet_4.jpg",
  ];

  const [currentImageIndex, setCurrentImageIndex] = useState(0);

  const nextSlide = () => {
    setCurrentImageIndex((prevIndex) => (prevIndex === images.length - 1 ? 0 : prevIndex + 1));
  };

  const prevSlide = () => {
    setCurrentImageIndex((prevIndex) => (prevIndex === 0 ? images.length - 1 : prevIndex - 1));
  };

  const goToSlide = (index) => {
    setCurrentImageIndex(index);
  };

  useEffect(() => {
    const interval = setInterval(() => {
      nextSlide();
    }, 5000);

    return () => clearInterval(interval);
  }, []);

  return (
    <section className="hero">
      <div className="hero-decoration hero-circle"></div>
      <div className="hero-decoration hero-dots"></div>
      
      <div className="hero-container">
        <div className="hero-content">
          <h1 className="hero-title">
            Find Your Dream Chalets in Switzerland
          </h1>
          <p className="hero-subtitle">
            Only the finest chalets, chosen for you.
            We have hand-selected the most beautiful and perfect Swiss chalets, 
            offering an unmatched blend of luxury, comfort, and stunning natural surroundings.
          </p>
          
          <div className="hero-buttons">
            <a href="#search" className="hero-btn hero-btn-primary">
              <FiSearch /> Explore Chalets <FiArrowRight />
            </a>
          </div>
          
          <div className="hero-stats">
            <div className="hero-stat">
              <span className="hero-stat-number">10+</span>
              <span className="hero-stat-label">Properties</span>
            </div>
            <div className="hero-stat">
              <span className="hero-stat-number">95%</span>
              <span className="hero-stat-label">Customer Satisfaction</span>
            </div>
            <div className="hero-stat">
              <span className="hero-stat-number">15+</span>
              <span className="hero-stat-label">Years Experience</span>
            </div>
          </div>
        </div>
        
        <div className="hero-image-container">
          <div className="hero-carousel">
            {images.map((image, index) => (
              <img 
                key={index}
                src={image} 
                alt={`Luxury Swiss home ${index + 1}`} 
                className={`hero-image ${index === currentImageIndex ? 'active' : ''}`}
                loading="lazy"
              />
            ))}

            {/* Navigation Arrows */}
            <button 
              className="carousel-arrow carousel-arrow-left" 
              onClick={prevSlide}
              aria-label="Previous slide"
            >
              <FiChevronLeft />
            </button>
            <button 
              className="carousel-arrow carousel-arrow-right" 
              onClick={nextSlide}
              aria-label="Next slide"
            >
              <FiChevronRight />
            </button>

            <div className="carousel-dots">
              {images.map((_, index) => (
                <button 
                  key={index} 
                  className={`carousel-dot ${index === currentImageIndex ? 'active' : ''}`}
                  onClick={() => goToSlide(index)}
                  aria-label={`Go to slide ${index + 1}`}
                />
              ))}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Hero;
